package com.example.entity;import jakarta.persistence.*;import lombok.AllArgsConstructor;import lombok.Data;import lombok.NoArgsConstructor;@Entity@Table(name = "article_like")@Data@NoArgsConstructor@AllArgsConstructorpublic class ArticleLikeEntity extends BaseStringEntity {    @Column(name = "profile_id")    private Long profileId;    @ManyToOne(fetch = FetchType.LAZY)    @JoinColumn(name = "profile_id", insertable = false, updatable = false)    private ProfileEntity profileEntity;    @Column(name = "article_id")    private String articleId;    @ManyToOne(fetch = FetchType.LAZY)    @JoinColumn(name = "article_id", insertable = false, updatable = false)    private ArticleEntity articleEntity;    @Enumerated(EnumType.STRING)    private Status status;    public enum Status {        LIKE, DIS_LIKE    }}